import React, { Component } from "react";

class Telstra extends Component {	 
	render() {
		return (
            <div className='subheader'>
                <div className='principal'>
                    <p>Telstra is Australia's largest telecommunications company, providing 17.7 million retail mobile services, 4.9 million retail fixed voice services and 3.6 million retail fixed broadband services. Since their formation in 1975, Telstra have been consistently bringing innovative technology, capability and talent from around the world to enable their customers to thrive in a connected world.</p>
                    <p>Telstra aims to empower businesses with innovative technology solutions including data and IP networks and network application services such as managed networks, unified communications, cloud, industry solutions, integrated software applications and services, and network-as-a-service. Their purpose in 'creating a brilliant connected future for everyone' aims to focus on 3 key issues to make a meaningful impact - responsible business, digital futures and environmental solutions.</p>
                    <p>Although Telstra's heritage is proudly Australian, the global technology company has a longstanding international business with a focus on the Asia-Pacific Region with over 3,500 employees based in 20 countries outside of Australia.</p>
                </div>
                <br></br>
                <a href="https://www.telstra.com.au/" className="button" >Visit Telstra</a>
            </div>
        );
	}
}

export default Telstra;
